import styled from "styled-components"


export const Container = styled.div` 
    max-width: 1200px;
    margin: 50px auto;
`;

export const Content = styled.div`
    display: grid;
    h1{
        margin-bottom: 50px;
    }
`;

export const Project = styled.div`
    display: grid;


`;

export const Block = styled.div`
    width: 100%;
    height: 100%;
    transition: .12s ease-in 0s;
    position: relative;
    cursor: pointer;
    overflow: hidden;


`;
